import React from 'react';
import QuoteItem from './QuoteItem';

const Quotes = (quotes, count) => {
  return (
    <div>
      {quotes.map(quote => (
        <QuoteItem quote={quote} />
      ))}
    </div>
  );
};

const quoteStyle = {
  display: 'flexbox',
  flexDirection: 'column'
};

export default Quotes;
